import React from "react";

const aboutStyle = {
    margin: '4em 1em',
};
const sanaIcon = {
    width: '80px',
};
const fontStyle = {
    fontFamily: 'Panchang',
    fontSize: '0.9em',
    letterSpacing: '1px',
};
const listStyle = {
    listStyle: 'disc',
    marginLeft: '2em',
};
const prologue = {
    margin: '2em 0',
};

const About = () => {
    return (
        <>
            <h2>Prologue</h2>
            <div style={aboutStyle}>

                <div style={prologue}>
                    <p>
                        "呼吸をする　自然"
                    </p>
                </div>
                <h3 style={fontStyle}>About myself</h3>
                <img src="./img/sana.png" alt="sana" style={sanaIcon} />
                <p>Hello :) I'm Sana.<br />
                    This is my coding sketchbook.<br />
                    I love to express emotional web content.</p>
                <p>My website : <a href="http://hi37.wp.xdomain.jp/" target="_blank" rel="noreferrer">Sana＊Works LAB</a></p>

                <ol className="use-list">
                    <li><h4>Using</h4></li>
                    <li style={listStyle}>CSS3</li>
                    <li style={listStyle}><a href="https://ja.reactjs.org/" target="_blank" rel="noreferrer">React</a></li>
                    <li style={listStyle}><a href="https://threejs.org/" target="_blank" rel="noreferrer">Three.js</a></li>
                    <li style={listStyle}><a href="https://www.blender.org/" target="_blank" rel="noreferrer">Blender</a></li>
                </ol>

            </div>
        </>
    )
};

export default About;
